import React from 'react';
import './App.css';

function UserItem({ user, onDelete, onUpdate }) {
    return (
        <div className='row m-2'>
            <tr key={user._id}>
                <td>{user.first_name}</td>
                <td>{user.last_name}</td>
                <td>{user.primary_address.street_address || ''}</td>
                <td>{user.primary_address.Province || ''}</td>
                <td>{user.primary_address.PostalCode || ''}</td>
                <td>
                    <button className="btn btn-warning btn-sm float-end" onClick={() => onDelete(user._id)}>Delete</button>
                    <button className="btn btn-warning btn-sm float-end" onClick={() => onUpdate(user._id)}>Update</button>
                </td>
            </tr>
        </div>
    );
}

export default UserItem;
